import React from "react";
import { NavLink } from "react-router-dom";

const Home = () => {

    return(
        <div>
            
            <NavLink to="./Home"><button type="button" className="btn btn-primary">Home</button></NavLink>

            <NavLink to="./Patient"><button type="button" className="btn btn-primary">Patient</button></NavLink>
                         
            
             
            <NavLink to="./Clinician"><button type="button" className="btn btn-primary">Clinician</button></NavLink>
             
            
        </div>
    );

};

export default Home;
